INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24015, 1, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, "カオリ（サマー）", 4, "2030/12/17 14:59:59", 0.0, 110501, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24016, 2, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, "カオリ（サマー）", 1, "2030/12/17 14:59:59", 0.0, 110501, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24017, 3, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, "カオリ（サマー）", 4, "2030/12/17 14:59:59", 0.0, 110501, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24018, 4, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 0.0, 110501, 1, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24019, 5, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, "カオリ（サマー）", 6, "2030/12/17 14:59:59", 0.0, 110501, 5, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24020, 6, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 0.0, 110501, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24021, 7, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, "カオリ（サマー）", 6, "2030/12/17 14:59:59", 0.0, 110501, 1, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24022, 8, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 0.0, 110501, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24023, 9, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, "カオリ（サマー）", 3, "2030/12/17 14:59:59", 0.0, 110501, 6, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24024, 10, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 0.0, 110501, 1, "2019/07/31 12:00:00");
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (0.0, 24, 24025, 11, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 0.0, 110501, 2, "2019/07/31 12:00:00");
